class MultiHeadSelfAttention(nn.Module):
      def __init__(self, num_heads, hidden_size):  # hidden_size = 토큰 임베딩 차원 = d_model
        super().__init__()
        self.num_heads = num_heads  # h = 8
        self.attn_head_size = int(hidden_size / num_heads)  # 512 / 8 = 64 헤드에서의 차원
        self.head_size = self.num_heads * self.attn_head_size  # 8 * 64 = 512 모든 헤드를 합친 총 차원 = hidden_size

        # self.Q, K, V 는 nn.Linear 객체
        # self.Q = nn.Linear(hidden_size, self.head_size)
        # 내부적으로 파라미터 W_Q와 바이어스 b_Q를 만들어둠
        # W_Q shape = (head_size, hidden_size), b_Q shape = (head_size,)
        self.Q = nn.Linear(hidden_size, self.head_size)  # 512 -> 512
        self.K = nn.Linear(hidden_size, self.head_size)  # 512 -> 512
        self.V = nn.Linear(hidden_size, self.head_size)  # 512 -> 512
        self.dense = nn.Linear(hidden_size, hidden_size)  # 512 -> 512

      def reshape_for_head(self, x):  # x.shape = (B, 토큰 개수 L, hidden_size), 예시 - (32, 100, 512)
        # x.size()[:-1] -> x의 맨 마지막 차원을 제외한 앞의 모든 차원을 튜플로 뽑음
        # 즉 x_shape = (B, L) + (헤드 개수, 각 헤드 차원) = (B, L, 헤드 개수, 한 헤드차원)
        # 예시 - (32, 100, 8, 64)
        x_shape = x.size()[:-1] + (self.num_heads, self.attn_head_size)

        # * = 언패킹 연산자
        # *x_shape => 튜플이었던게 32, 100, 8, 64로 풀려서 x.view(32, 100, 8, 64)
        # 즉 (B, L, hidden_size) 였던 입력을 헤드 입력으로 나누려고 (B, L, num_heads, attn_head_size) 로 reshape
        x = x.view(*x_shape)

        # (B, L, num_heads, attn_head_size) -> (B, num_heads, L, attn_head_size)
        # (32, 100, 8, 64) -> (32, 8, 100, 64) => 8개의 헤드에 (100, 64)가 있다
        return x.permute(0, 2, 1, 3)

      def forward(self, hidden_states):
        # hidden_states = (B, L, hidden_size)
        # self.Q(hs) -> 내부적으로 self.Q.forward(hs) 가 호출됨
        # 즉 hidden_states가 nn.Linear의 forward 메소드로 전달되서 행렬곱과 바이어스 더하기가 실행됨
        # Q @ W_Q^T = (B, L, hidden_size) @ (hidden_size, head_size) = (B, L, head_size)
        # 즉 입력이 Query, Key, Value로서의 역할을 할 수 있도록 함
        Q, K, V = self.Q(hidden_states), self.K(hidden_states), self.V(hidden_states)

        # Q, K, V를 헤드 입력 차원으로 바꾸기
        Q_layer, K_layer, V_layer = self.reshape_for_head(Q), self.reshape_for_head(K), self.reshape_for_head(V)

        # 어텐션 스코어 구하기
        # (B, H, L, attn_head_size) @ (B, H, attn_head_size, L) =  (B, H, L, L)
        attn = torch.matmul(Q_layer, K_layer.transpose(-1, -2)) / math.sqrt(self.attn_head_size)

        # 어텐션 분포 구하기
        attn = nn.Softmax(dim=-1)(attn)

        # 어텐션값 (가중합) 구하기
        # 첫번째 토큰에 대한 연관도가 [0.2, 0.3, 0.5]라고하고
        # V = [[1, 4], [2, 5], [3, 6]] 이면
        # (1, 4)이 첫째 토큰의 Value 벡터,  (2, 5)가 두번째 토큰 Value 벡터, ...
        # 둘을 행렬곱하면 각 Value 벡터에 대응하는 연관도를 곱해진 후, 이를 더하므로 가중합
        # 그럼 output의 첫번째 행의 첫번째 원소는, 첫번째 토큰에 대한 연관도를 가중치로 하는,
        # 각 토큰의 Value 벡터의 첫번째 원소들의 가중합
        # (B, H, L, L) @ (B, H, L, attn_head_size) = (B, H, L, attn_head_size)
        output = torch.matmul(attn, V_layer)

        # (B, L, H, atttn_head_size)
        output = output.permute(0, 2, 1, 3).contiguous()

        # (B, L, hidden_size) 원래 차원으로 복귀
        output_shape = output.size()[:-2] + (self.head_size,)
        output = output.view(*output_shape)

        Z = self.dense(output)

        return Z

